import { getRateKor } from "../rate"
import { instance } from "../services"

export const getSalesHistorySoldOut = async() => {
    const response = await instance.get('https://www.soldout.co.kr/api/v3/product/item/get-item-order-graph?item_id=3333&type=1w')
    const rate = await getRateKor()
    const data = response.data.data['1w'].trade_list
    const arr = []
    for (let i = data.length; i>data.length-20; i--) {
        arr.push(
            {
                size: parseInt(data[i].option),
                price: data
            }
        )
    }
    return data
}
